import List from "./List";

const TreeList = ({ data, onListToggle }) => {
  return (
    <div className="list">
      <h5>Checking the list view</h5>
      {Object.keys(data).length ? (
        <List list={data} onToggle={onToggle} toggleList={toggleList} />
      ) : (
        "No List"
      )}
    </div>
  );
};

export default TreeList;
